import React from 'react'
import BrandLogo from "../images/logoImg.png"
import '../style/_logo.scss'

class Logo extends React.Component {
    render () {
    return 
         <div>
        <img class="logo-img" src={BrandLogo} alt="" />
        </div>

    }
}

export default Logo
